import Colors from '../../styles/Colors';
import { makeStyles, createStyles, Theme } from '@material-ui/core/styles';

const Styles = makeStyles((theme: Theme) =>
  createStyles({
    footerContainer: {
      backgroundColor: Colors.slate,
      height: '20%',
      textAlign: 'center',
    },
    footerFontColor: {
      color: Colors.white,
      fontWeight: 'bold',
    },
    footerTextField: {
      width: '30%',
    },
  })
);

export default Styles;
